import './footer.scss'


function Footer() {
  return (
    <nav className="footer-container">
      <ul className="footer-ul">
        <li className="footer-li"><a className="footer-a" rel target="_blank" href="https://github.com/Nexus8th">Github</a></li>
        <li className="footer-li"><a className="footer-a" target="_blank" href="https://juliens1031.promo-108.codeur.online/portfolio/">Linkedin</a></li>
      </ul>
    </nav>
  )
}

export default Footer
